The project is organized as follows:    The  contract  folder contains all the main contracts written in Solidity.   The  test  folder contains all the test files written in JavaScript. These modules can be independently developed, tested, and integrated into the overall system, allowing for flexibility and scalability in the marketplace s features and functionality. This approach allows for easy customization and modification of the marketplace, as well as the potential to add new features and capabilities over time.. Are you ready to revolutionize the world of NFT gaming? Look no further than our cutting-edge platform! We offer:
1) A seamless NFT marketplace experience, allowing your customers to showcase and purchase unique digital assets with ease! Our ERC1155 protocol allows for seamless NFT minting using smart contracts, giving creators complete control over their digital masterpieces;
2) Our fee manager makes complicated fee structures a thing of the past. Set fees and fee receiver addresses effortlessly, and watch your customer satisfaction soar.

But that's just the beginning;
3) Our platform elevates NFTs to the next level with our encoding metadata feature, allowing for unparalleled customization and personalization. And with our secure refund process using a configurable Chainlink Oracle, trust and security are our top priorities;
4) Plus, our code is compatible with any EVM, including Ethereum, Polygon, Avalanche, and more;

Lastly, you can:
5) Empower your users with a game-changing marketplace that allows them to RENT NFTs for short periods of time with customizable rental prices and duration;
6) Attract NFT collectors to your platform with an exclusive AUCTION feature that allows them to bid on rare and coveted NFTs;
7) Offer your customers the best deals on BUNDLES of related NFTs, making it easier than ever to complete their collection.

Revamp your NFT marketplace and attract a whole new audience with our game-changing features! From renting NFTs for short-term gaming missions, to bidding on rare NFTs in exciting auctions, to buying NFT bundles, our marketplace has it all. With these versatile features, you'll unlock a world of possibilities for your users and drive more activity and revenue than ever before!
Join our platform and offer your customers the ultimate flexibility in digital asset trading!. Looking for a cutting-edge NFT marketplace solution? Our Solidity and JavaScript code makes deploying and testing smart contracts on EVM-compatible blockchains a breeze. Our modules allow for easy customization and testing, while our team of experts ensures a seamless implementation. Experience the future of NFT gaming with our seamless marketplace, featuring personalized encoding metadata, configurable Chainlink Oracle refunds, and more, backed by our compatibility with all EVMs. Plus, attract customers with our rental and auction features, and bundle deals. Join us today and take your digital asset trading to the next level!

