Air conditioner control board It s a MikroC source code for controlling multi feature Air conditioner can be uploaded on PIC18f4520 microcontroller and a PCB board can be made to control the operation of the conditioner.Running Air conditioner on different modes like cooling, heating, dry and sleep. Multi speed Indoor fan . Operating swings. Stopping compressor at emergency cases.The source code has loops, if statements, interrupt signals,.........etc.It s easy to understand, add, modify and develop.this is a brief of the code: void change_temperature()

     temp   ADC_Read(0);               //Read temperature from AN0
     mV   temp   5000.0/1023.0;        //Convert to mV
     ActualTemp   mV/10.0 ;             // Convert to degrees Celcius
     display_init();
      if (Button( PORTa, 3, 1, 1))      //reference temperature count down
       delay_ms(90);
       Tref--;

     if (button( porta, 2, 1, 1))        //reference temperature count up
     delay_ms(90);
     Tref  ;
     display_init();. Air conditioner control board It s a MikroC source code for controlling multi feature Air conditioner can be uploaded on PIC18f4520 microcontroller and a PCB board can be made to control the operation of the conditioner.Running Air conditioner on different modes like cooling, heating, dry and sleep. Multi speed Indoor fan .. Looking for advanced control options for your air conditioner? Check out our MikroC source code that enables you to easily manage multi-mode features including cooling, heating and more! Designed for use with the PIC18f4520 microcontroller, our code can be uploaded and modified with ease. With powerful features like multi-speed fan control, operating swings and compressor stop, you'll have everything you need to keep your home comfortable. So why wait? Upgrade your air conditioner control board with our easy-to-use source code today!
